import './App.css';
import {NavLink} from "react-router-dom";
import Home from './home'
import { BrowserRouter as Router, Switch, Route, Redirect,} from "react-router-dom";


function App() {
  return (
    <>
    <Router>
        <Route exact path ="/" Component = {Home} />
        <Redirect to="/" />
    </Router>

    </>
  );
}

export default App;
